INSERT INTO `blog_post` (`id_blog`, `title_blog`, `content_blog`, `reference`, `category`, `username`, `date_blog`) VALUES
(1, 'Machine learning was used to sync subtitles in Games', '<p><img alt=\"\" src=\"https://eu-images.contentstack.com/v3/assets/blt740a130ae3c5d529/blt0474a354490bd8e7/665095d4f5c3205c6b0b1b20/Spider_Man_2_Header.png?width=850&amp;auto=webp&amp;quality=95&amp;format=jpg&amp;disable=upscale\" style=\"height:478px; width:850px\" /></p>\r\n\r\n<h2><br />\r\n<em>Sony&#39;s got a big plan for the future of video games, and it involves super smart computers! They believe Artificial Intelligence (AI) and machine learning can speed up and cheapen game development. In fact, they&#39;ve already used this tech on the new Spider-Man game. With AI&#39;s help, they were able to automatically translate spoken words into subtitles for different languages, which saved a ton of time.</em></h2>\r\n\r\n<h3>Sony&#39;s 10-year plan focuses on using technology to boost creativity. They want to make it easier for game developers to come up with amazing ideas. They also want to connect more people through games and create experiences that blow our minds!</h3>\r\n\r\n<h3>Here&#39;s the exciting part: Sony says AI can be a powerful tool for game creators. These AI tools could lower the cost of making games, freeing up developers to focus on the fun stuff &ndash; like the story, characters, and overall awesomeness of the game. It&#39;s kind of like how games went from hand-drawn cartoons to using real actors&#39; movements to tell stories &ndash; AI is the next big leap in game development!</h3>\r\n\r\n<h3>Of course, Sony isn&#39;t the only company looking into AI for games. Other big names like EA and Microsoft are on board too. They all believe AI can empower developers and make games cheaper. However, some game makers are worried. They fear that using AI to save money might lead to job cuts in the industry.</h3>\r\n', 'https://www.gamedeveloper.com/production/machine-learning-was-used-to-sync-subtitles-in-marvel-s-spider-man-2', 4, 1, '2024-05-29'),
(2, 'VR dev Sinn Studio raises $2.5M to fund next Game', '<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"https://eu-images.contentstack.com/v3/assets/blt740a130ae3c5d529/bltfcb9c714a581c357/66562dee597210eaebd849cc/swordsman_vr.jpg?width=700&amp;auto=webp&amp;quality=80&amp;disable=upscale\" style=\"height:563px; width:1000px\" /></p>\r\n\r\n<h2><em>Toronto-based game developer Sinn Studio is creating a new virtual reality (VR) combat game that they believe will revolutionize VR combat.</em></h2>\r\n\r\n<h3>The studio, founded in 2017 by Alek Sinn and Almir Brljak, has secured $2.5 million in funding to develop this new project. The funding came from various sources, including investment firm Hartmann Capital, Boost VC, and Republic. Sinn expressed his gratitude to these partners for helping them &ldquo;redefine the future of combat in this exciting new era of spatial computing.&rdquo;</h3>\r\n\r\n<h3>Sinn Studio has experience in the VR world. Their first project, Swordsman VR, was released in 2020 for several VR platforms and has been a success. According to Sinn&rsquo;s LinkedIn page, Swordsman VR has sold over 425,000 copies and generated over $7.1 million in revenue.</h3>\r\n\r\n<h3>While the details of their new project haven&#39;t been revealed yet, we do know it will be a multiplayer VR combat game and will be free-to-play. The game will reportedly use a Large Intent Model (LIM) neural network to &ldquo;discern and learn from the intricate subtleties of human motion during combat.&rdquo; This technology is said to not only enhance their own VR combat experiences but also potentially be applicable to other games in the future.</h3>\r\n', 'https://www.gamedeveloper.com/business/vr-studio-sinn-studio-raises-2-5m-to-fund-next-project', 6, 1, '2024-05-29'),
(10, 'Something unexpected collab from Minecraft and Netflix to make animated series', '<p><img alt=\"\" src=\"https://eu-images.contentstack.com/v3/assets/blt740a130ae3c5d529/blt8165feb12f2c086d/66585c11af8f5d93a3ffca78/Minecraft_Header.png?width=850&amp;auto=webp&amp;quality=95&amp;format=jpg&amp;disable=upscale\" /></p>\r\n\r\n<h1><strong>Netflix and Mojang to create animated Minecraft series!!</strong></h1>\r\n\r\n<h2><em>Minecraft fans rejoice! Netflix and Mojang Studios are teaming up for a new animated series based on the popular sandbox game. This is another example of big entertainment players joining forces &ndash; Netflix and Microsoft (Mojang&#39;s parent company) are collaborating to bring Minecraft to life in a new way.</em></h2>\r\n\r\n<h3>The series will feature a brand new story with fresh characters, offering a unique perspective on the blocky world. WildBrain, the animation studio behind shows like Sonic Prime and Carmen Sandiego, will be crafting the CG animation for the series. There&#39;s no word on the release date yet, but the show will be exclusive to Netflix.</h3>\r\n\r\n<h3>This isn&#39;t Netflix&#39;s first foray into Minecraft content. They previously partnered with Telltale Games on a Minecraft: Story Mode interactive series, but that project was ultimately cancelled.</h3>\r\n\r\n<h3>The Minecraft series is another sign of a growing trend: major video game studios are looking to streaming services to expand their reach and create new content based on beloved franchises. Recent successes like the Super Mario Bros. and The Last of Us adaptations show the potential of this approach. Other companies like Riot Games, CD Projekt Red, and Sega have also jumped on board, bringing their games to streaming platforms and big screens. With the Minecraft series on the horizon, it seems this trend is here to stay.</h3>\r\n', 'https://www.gamedeveloper.com/business/netflix-and-mojang-to-create-animated-minecraft-series', 7, 1, '2024-05-30'),
(11, 'Upcoming Collaboration: \"Orange Cat Purr-totype\"', '<p><em>&quot;Mungkin dikehidupan lainnya kamu adalah seekor kucing oren... mungkin saja...&quot;</em>&nbsp;&nbsp;kata seorang penguji lab&nbsp;yang terdengar&nbsp;beberapa detik sebelum mataku terpejam dan semuanya benar benar sunyi begitu saja. Anehnya, hanya itu yang kuingat.</p>\r\n\r\n<p>Terbangun di sebuah laboratorium rahasia di mana Anda, seorang manusia biasa, tanpa sengaja menjadi subjek uji coba eksperimen yang aneh. Tiba-tiba, Anda menemukan diri Anda terperangkap dalam tubuh lucu dan lincah seorang kucing oren.....</p>\r\n\r\n<p>Tetapi jangan khawatir, petualangan Anda belum berakhir!<br />\r\n<br />\r\nMulai&nbsp;petualangan kamu dengan merasakan sensasi menjelajahi dunia dari perspektif kucing~&nbsp;<br />\r\nNamun, jangan lupakan tujuan utama untuk&nbsp;mencari cara untuk kembali ke tubuh manusia-mu!<br />\r\nSelama petualangan ini, kamu&nbsp;akan menemukan petunjuk-petunjuk yang menarik dan mungkin saja mengungkap rahasia gelap di balik eksperimen laboratorium tersebut.<br />\r\n<img alt=\"\" src=\"https://i.pinimg.com/564x/cc/b1/0d/ccb10d7bd1216f02910db32b782b9708.jpg\" /></p>\r\n', '', 7, 2, '2024-05-30');

